import {Box} from '@chakra-ui/react';

export const Recreation = ({height = `51`, width = `51`, ...rest}) => {
  return (
    <Box height={height} width={width} {...rest}>
      <svg
        width="100%"
        height="100%"
        viewBox="0 0 51 51"
        fill="none"
        // xmlns="http://www.w3.org/2000/svg"
        // xmlns:xlink="http://www.w3.org/1999/xlink"
      >
        <g style={{mixBlendMode: 'difference'}}>
          <rect
            width="50"
            height="50"
            transform="translate(0.5 0.5)"
            fill="url(#pattern0_19_2642)"
          />
        </g>
        <defs>
          <pattern
            id="pattern0_19_2642"
            patternContentUnits="objectBoundingBox"
            width="1"
            height="1"
          >
            <use xlinkHref="#image0_19_2642" transform="scale(0.0078125)" />
          </pattern>
          <image
            id="image0_19_2642"
            width="128"
            height="128"
            xlinkHref="data:image/png;base64,"
          />
        </defs>
      </svg>
    </Box>
  );
};

